window.bookSummaryJSON = "<p><b>Dragons are the enemy of the kingdom, and Alice is now their master.</b></p> <p>Living a life of grinding poverty in the General Laborer class, Alice's only hope was the System would someday notice her and reward her hard work.</p> <p>That day arrives when she discovers a System-seed, a one-time chance to change from the lowest to the highest of classes.</p> <p>Now, she is a rare minion-master in charge of an ever-growing horde of dragons. Dragons that will not stay small and cute forever. As each grows and multiplies, so does her power.</p> <p>Alice has become She of Many Dragons.</p>"; 
